import Nav from './Nav';
import Card from "./Card";
import Header from "./Header";

function App() {





  return (
    <div className="App">
      <div className="navigation-bar">
        <Nav />
      </div>

      <div className="content-container">
        <Header />
        <Card />
      </div>

    </div>
  );
}

export default App;
